import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Card from './Card';
import reportWebVitals from './reportWebVitals';
import 'tachyons';
import { cyclists } from './cyclists'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className="cycling-app">
      <Card id={cyclists[0].id} name={cyclists[0].name} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[1].id} name={cyclists[1].name} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[2].id} name={'Delgado'} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[3].id} name={'Delgado'} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[4].id} name={'Delgado'} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[5].id} name={'Delgado'} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[6].id} name={'Delgado'} description={'1988 Tour de France Winner'}/>
      <Card id={cyclists[7].id} name={'Delgado'} description={'1988 Tour de France Winner'}/>
    </div>
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
